import React from 'react';
import { View, Text, StyleSheet, Image } from 'react-native';

export function Title(){
    return (
        <View>
            <Image source={require('../../assets/logo/new-logo-yin-yang/transparent.png')} styles={styles.tinyLogo}/>
            <Text style={styles.title}>Face Morpher</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    title: {
        marginTop: 70,
        fontSize: 35 ,
        color: 'whitesmoke',
        fontFamily: 'Roboto'
    },
    tinyLogo: {
        width: 50,
        height: 50,
    }
});
